import React, { useState } from 'react';
import { Container, Grid, Typography, TextField, Button, Box, Snackbar, Alert, Table, TableBody, TableRow } from '@mui/material';
import image from '../../assets/WhatsApp Image 2024-11-15 at 8.28.08 PM.jpeg'
const ContactForm = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        subject: '',
        phone: '',
        message: ''
    });

    const [errors, setErrors] = useState({
        email: false,
        phone: false,
        message: false
    });

    const [success, setSuccess] = useState(false);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const validateEmail = (email) => {
        const emailRegex = /^[a-zA-Z0-9._%+-]+@gmail\.com$/;
        return emailRegex.test(email);
    };

    const validatePhone = (phone) => {
        const phoneRegex = /^[0-9]{10}$/;
        return phoneRegex.test(phone);
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        const isEmailValid = validateEmail(formData.email);
        const isPhoneValid = validatePhone(formData.phone);
        const isMessageValid = formData.message.trim() !== '';

        if (!isEmailValid || !isPhoneValid || !isMessageValid) {
            setErrors({
                email: !isEmailValid,
                phone: !isPhoneValid,
                message: !isMessageValid
            });
            return;
        }

        const subject = encodeURIComponent(`Appointment Request: ${formData.subject}`);
        const body = encodeURIComponent(
            `Name: ${formData.name}\nEmail: ${formData.email}\nPhone: ${formData.phone}\n\nMessage:\n${formData.message}`
        );

        window.location.href = `mailto:gowthampatel024@gmail.com?subject=${subject}&body=${body}`;
        setFormData({
            name: '',
            email: '',
            subject: '',
            phone: '',
            message: ''
        });
        setErrors({
            email: false,
            phone: false,
            message: false
        });
        setSuccess(true);
    };

    const handleClose = () => {
        setSuccess(false);
    };

    return (
        <Container sx={{ py: 15 }}>
            <Grid container spacing={4}>
                <Grid item xs={12} md={6}>
                    <Box
                        sx={{
                            display: 'flex',
                            flexDirection: 'column',
                            alignItems: 'center',
                            textAlign: 'center',
                            mb: 4,
                        }}
                    >
                        <Typography variant="h6" sx={{ mb: 1, color: '#004e6a' }}>
                            <Box component="span" sx={{ display: 'inline-flex', alignItems: 'center', mb: 1 }}>
                                <Box
                                    component="span"
                                    sx={{
                                        display: 'inline-block',
                                        width: 24,
                                        height: 24,
                                        bgcolor: '#004e6a',
                                        borderRadius: '50%',
                                        mr: 1,
                                    }}
                                />
                                Contact Us!
                            </Box>
                        </Typography>
                        <Typography variant="h4" fontWeight="bold" gutterBottom>
                            Got Questions? Let's Connect!
                        </Typography>
                    </Box>

                    {/* Table layout for the form fields */}
                    <Box
                        sx={{
                            display: 'flex',
                            flexDirection: 'column',
                            alignItems: 'center',
                            textAlign: 'center',
                            mb: 4,
                            gap: 5, // Adds spacing between fields
                        }}
                    >
                        <Table>
                            <TableBody>
                                <TableRow sx={{ marginBottom: '26px', display: 'block' }}>
                                    <TextField
                                        fullWidth
                                        label="Enter Your Name"
                                        variant="standard"
                                        name="name"
                                        value={formData.name}
                                        onChange={handleChange}
                                    />
                                </TableRow>
                                <TableRow sx={{ marginBottom: '26px', display: 'block' }}>
                                    <TextField
                                        fullWidth
                                        label="Enter Your Email"
                                        variant="standard"
                                        name="email"
                                        value={formData.email}
                                        onChange={handleChange}
                                        error={errors.email}
                                        helperText={errors.email ? 'Please enter a valid Gmail address.' : ''}
                                    />
                                </TableRow>
                                <TableRow sx={{ marginBottom: '6px', display: 'block' }}>
                                    <TextField
                                        fullWidth
                                        label="Phone Number"
                                        variant="standard"
                                        name="phone"
                                        value={formData.phone}
                                        onChange={handleChange}
                                        error={errors.phone}
                                        helperText={errors.phone ? 'Please enter a valid 10-digit phone number.' : ''}
                                    />
                                </TableRow>
                            </TableBody>
                        </Table>
                    </Box>

                    <Box sx={{ display: 'flex', justifyContent: 'center' }}>
                        <Button
                            variant="contained"
                            size="large"
                            type="submit"
                            sx={{
                                mt: 3,
                                background: 'linear-gradient(to right, #004e6a)',
                                borderRadius: '30px',
                                '&:hover': {
                                    backgroundColor: '#004e6a',
                                },
                            }}
                            onClick={handleSubmit}
                        >
                            Make an Appointment
                        </Button>
                    </Box>
                </Grid>

                <Grid item xs={12} md={6}>
                    <img 
                    src={image}
                    alt='image'
                    style={{width:'100%', height:'100%', borderRadius:'10px'}}
                    />

                </Grid>


                <Grid item xs={12} md={12}>
  <Box sx={{ marginTop: '80px', paddingLeft: { md: '20px', xs: '-5px' } }}>
    <iframe
      src="https://www.google.com/maps/place/GetMyCollege/@12.9461283,77.5702628,15z/data=!4m6!3m5!1s0x3bae15eb1e779041:0xeaf1f608433aec66!8m2!3d12.9461283!4d77.5702628!16s%2Fg%2F11vwhmxbws?entry=ttu&g_ep=EgoyMDI0MTExMy4xIKXMDSoASAFQAw%3D%3D"
      width="100%"
      height="400"
      style={{ border: 0, borderRadius: '10px' }}
      allowFullScreen=""
      loading="lazy"
    ></iframe>
  </Box>
</Grid>


            </Grid>
            <Snackbar open={success} autoHideDuration={6000} onClose={handleClose}>
                <Alert onClose={handleClose} severity="success" sx={{ width: '100%', top: 20 }}>
                    Message sent successfully!
                </Alert>
            </Snackbar>
        </Container>
    );
};

export default ContactForm;
